import './App.css';
import DisplayPaintings from './components/DisplayPaintings';
import Header from './components/Header';

function App() {
  return (
    <div className="App">
      <Header />
      <div className="container">
        <DisplayPaintings />
      </div>
    </div>
  );
}

export default App;
